import React, { useRef } from "react";
import { FaChevronLeft, FaChevronRight } from "react-icons/fa";
const properties = [
  {
    id: 1,
    title: "2 BHK Luxury Apartment",
    location: "New Delhi, India",
    price: "₹52,00,000",
    seller: "Amit Sharma",
    image:
      "https://images.unsplash.com/photo-1600585154340-be6161a56a0c?auto=format&fit=crop&w=1200&q=80",
  },
  {
    id: 2,
    title: "Modern Villa With Pool",
    location: "Bengaluru, India",
    price: "₹1,80,00,000",
    seller: "Sneha Verma",
    image:
      "https://images.unsplash.com/photo-1580587771525-78b9dba3b914?auto=format&fit=crop&w=1200&q=80",
  },
  {
    id: 3,
    title: "Fully Furnished Office Space",
    location: "Mumbai, India",
    price: "₹85,00,000",
    seller: "Rohan Gupta",
    image:
      "https://images.unsplash.com/photo-1554995207-c18c203602cb?auto=format&fit=crop&w=1200&q=80",
  },
  {
    id: 4,
    title: "Farm House With Garden",
    location: "Jaipur, India",
    price: "₹72,00,000",
    seller: "Meera Singh",
    image:
      "https://images.unsplash.com/photo-1507089947368-19c1da9775ae?auto=format&fit=crop&w=1200&q=80",
  },
  {
    id: 5,
    title: "3 BHK Premium Apartment",
    location: "Gurugram, India",
    price: "₹95,00,000",
    seller: "Arjun Mehta",
    image:
      "https://images.unsplash.com/photo-1560448075-bb4b5be0c3a9?auto=format&fit=crop&w=1200&q=80",
  },
  {
    id: 6,
    title: "Luxury Penthouse Skyview",
    location: "Pune, India",
    price: "₹2,10,00,000",
    seller: "Neha Kapoor",
    image:
      "https://images.unsplash.com/photo-1600607688969-a5bfcd646154?auto=format&fit=crop&w=1200&q=80",
  },
  {
    id: 7,
    title: "Cozy Studio Apartment",
    location: "Kolkata, India",
    price: "₹32,00,000",
    seller: "Vikas Rao",
    image:
      "https://images.unsplash.com/photo-1600585154207-5771a9b52f59?auto=format&fit=crop&w=1200&q=80",
  },
  {
    id: 8,
    title: "Commercial Office Tower Floor",
    location: "Hyderabad, India",
    price: "₹1,40,00,000",
    seller: "Krishna Patel",
    image:
      "https://images.unsplash.com/photo-1507099985932-87a4520ed1d1?auto=format&fit=crop&w=1200&q=80",
  },
];


const LatestProperties = () => {
  const sliderRef = useRef(null);

  const scrollLeft = () => {
    sliderRef.current.scrollBy({ left: -250, behavior: "smooth" });
  };

  const scrollRight = () => {
    sliderRef.current.scrollBy({ left: 250, behavior: "smooth" });
  };

  return (
    <section className="max-w-[1300px] mx-auto px-4 py-10">
      <h2 className="text-3xl font-bold text-center text-gray-800 mb-6">
        Latest <span className="text-blue-600">Properties</span>
      </h2>

      <div className="relative">

        {/* Left Button (Mobile + Desktop Visible) */}
        <button
          onClick={scrollLeft}
          className="
            absolute left-1 top-1/2 -translate-y-1/2 z-20
            bg-white/30 backdrop-blur-xl border border-white/20 shadow-lg
            p-2 rounded-full hover:scale-110 duration-300
            flex
          "
        >
          <FaChevronLeft className="text-white" size={18} />
        </button>

        {/* Slider */}
        <div
          ref={sliderRef}
          className="flex gap-4 overflow-x-auto scroll-smooth py-4 scrollbar-none"
        >
          {properties.map((p) => (
            <div
              key={p.id}
              className="
                bg-white shadow-md rounded-xl overflow-hidden 
                min-w-[180px] sm:min-w-[200px] md:min-w-[240px]
                hover:shadow-xl duration-300
              "
            >
              {/* Image */}
              <div className="h-32 sm:h-36 md:h-40 overflow-hidden">
                <img
                  src={p.image}
                  className="w-full h-full object-cover hover:scale-110 duration-500"
                  alt=""
                />
              </div>

<div className="p-3 bg-blue-500/20 backdrop-blur-lg rounded-b-xl border-t border-blue-200/10">
                <h3 className="text-[14px] sm:text-[15px] font-semibold text-gray-800">
                  {p.title}
                </h3>

                <p className="text-blue-600 font-bold text-sm mt-1">{p.price}</p>
                <p className="text-gray-500 text-xs">{p.location}</p>

                {/* Seller */}
                <div className="flex items-center gap-2 mt-3 bg-gray-100 py-1.5 px-2 rounded-lg">
                  <img
                    src={p.seller.avatar}
                    className="h-7 w-7 rounded-full border"
                    alt=""
                  />
                  <span className="text-[12px] sm:text-[13px] text-gray-700 font-medium">
                    {p.seller.name}
                  </span>
                </div>
              </div>
            </div>
          ))}
        </div>

        {/* Right Button (Mobile + Desktop Visible) */}
        <button
          onClick={scrollRight}
          className="
            absolute right-1 top-1/2 -translate-y-1/2 z-20
            bg-white/30 backdrop-blur-xl border border-white/20 shadow-lg
            p-2 rounded-full hover:scale-110 duration-300
            flex
          "
        >
          <FaChevronRight className="text-white" size={18} />
        </button>

      </div>
    </section>
  );
};

export default LatestProperties;
